(3, 'Kẹo Dẻo Actisô Galaxy Ladophar – Gói 80g', 0, '2021-07-23 08:45:29', '3M', 17, 0, 'https://appdala.net/wp-content/uploads/keodeo1-4.jpg', 'https://appdala.net/wp-content/uploads/keodeo2-3.jpg;https://appdala.net/wp-content/uploads/keodeo1-5.jpg;https://appdala.net/wp-content/uploads/keodeo3-1.jpg', '', '<div style=\"text-align: center;\"><span style=\"color: #666666; font-family: Arial, Helvetica, sans-serif; font-size: 24px; font-weight: bold; text-align: center; background-color: #ffffff;\">KẸO DẺO ACTISO<br /><img style=\"display: block; margin-left: auto; margin-right: auto;\" src=\"https://appdala.net/wp-content/uploads/keodeo1-3.jpg\" alt=\"\" width=\"300\" height=\"300\" /></span>\n<p style=\"margin: 0px; padding: 0px; color: #666666; font-family: Arial, Helvetica, sans-serif; font-size: 12.96px; text-align: start; background-color: #ffffff;\"><span style=\"margin: 0px; padding: 0px; font-size: 14pt;\">Kẹo dẻo actiso được chế biến từ cao hoa actiso, mang m&agrave;u n&acirc;u đặc trưng, dai dai, ngọt ngọt, l&agrave; m&oacute;n ăn vặt cực k&igrave; y&ecirc;u th&iacute;ch kh&ocirc;ng chỉ ri&ecirc;ng c&aacute;c em nhỏ m&agrave; người lớn cũng m&ecirc;.</span></p>\n<p style=\"margin: 0px; padding: 0px; color: #666666; font-family: Arial, Helvetica, sans-serif; font-size: 12.96px; text-align: start; background-color: #ffffff;\"><span style=\"margin: 0px; padding: 0px; font-size: 14pt;\">Kẹo dẻo actiso mang hương vị Actiso tự nhi&ecirc;n, thơm ngon, c&ograve;n bổ sung dưỡng chất, c&oacute; &iacute;ch cho sức khỏe.</span></p>\n<p style=\"margin: 0px; padding: 0px; color: #666666; font-family: Arial, Helvetica, sans-serif; font-size: 12.96px; text-align: start; background-color: #ffffff;\"><span style=\"margin: 0px; padding: 0px; font-size: 14pt;\">Kẹo dẻo actiso lu&ocirc;n đảm bảo về chất lượng, l&agrave; sản phẩm an to&agrave;n cho người ti&ecirc;u d&ugrave;ng.</span></p>\n<p style=\"margin: 0px; padding: 0px; color: #666666; font-family: Arial, Helvetica, sans-serif; font-size: 12.96px; text-align: start; background-color: #ffffff;\"><span style=\"margin: 0px; padding: 0px; font-size: 14pt;\"><br /><img style=\"display: block; margin-left: auto; margin-right: auto;\" src=\"https://appdala.net/wp-content/uploads/keodeo2-2.jpg\" alt=\"\" width=\"300\" height=\"300\" /><br /></span></p>\n<ul style=\"margin: 1em 0px 1.4em 24px; padding: 0px; line-height: 18.144px; color: #666666; font-family: Arial, Helvetica, sans-serif; font-size: 12.96px; text-align: start; background-color: #ffffff;\">\n<ul style=\"margin: 1em 0px 1.4em 24px; padding: 0px; line-height: 18.144px; color: #666666; font-family: Arial, Helvetica, sans-serif; font-size: 12.96px; text-align: start; background-color: #ffffff;\">\n<li style=\"margin: 0px 0px 0.5em; padding: 0px;\"><span style=\"margin: 0px; padding: 0px; font-size: 14pt;\"><strong style=\"margin: 0px; padding: 0px;\">Th&agrave;nh phần</strong>: Cao hoa actiso 5%, đường, mạch nha, gelatin, pectin, acid citric.</span></li>\n</ul>\n</ul>\n<p style=\"margin: 0px; padding: 0px; color: #666666; font-family: Arial, Helvetica, sans-serif; font-size: 12.96px; text-align: start; background-color: #ffffff;\"><span style=\"margin: 0px; padding: 0px; font-size: 14pt;\">Kh&ocirc;ng sử dụng chất bảo quản.</span></p>\n<ul style=\"margin: 1em 0px 1.4em 24px; padding: 0px; line-height: 18.144px; color: #666666; font-family: Arial, Helvetica, sans-serif; font-size: 12.96px; text-align: start; background-color: #ffffff;\">\n<ul style=\"margin: 1em 0px 1.4em 24px; padding: 0px; line-height: 18.144px; color: #666666; font-family: Arial, Helvetica, sans-serif; font-size: 12.96px; text-align: start; background-color: #ffffff;\">\n<ul style=\"margin: 1em 0px 1.4em 24px; padding: 0px; line-height: 18.144px; color: #666666; font-family: Arial, Helvetica, sans-serif; font-size: 12.96px; text-align: start; background-color: #ffffff;\">\n<li style=\"margin: 0px 0px 0.5em; padding: 0px;\"><span style=\"margin: 0px; padding: 0px; font-size: 14pt;\"><strong style=\"margin: 0px; padding: 0px;\">KLT</strong>: 80g</span></li>\n<li style=\"margin: 0px 0px 0.5em; padding: 0px;\"><span style=\"margin: 0px; padding: 0px; font-size: 14pt;\"><strong style=\"margin: 0px; padding: 0px;\">Hạn sử dụng</strong>: 1 năm.</span></li>\n<li style=\"margin: 0px 0px 0.5em; padding: 0px;\"><span style=\"margin: 0px; padding: 0px; font-size: 14pt;\"><strong style=\"margin: 0px; padding: 0px;\">Hướng dẫn sử dụng</strong>: D&ugrave;ng trực tiếp sau khi mở bao b&igrave;. Đ&oacute;ng k&iacute;n sau mỗi lần sử dụng.</span></li>\n</ul>\n</ul>\n</ul>\n<p style=\"margin: 0px; padding: 0px; color: #666666; font-family: Arial, Helvetica, sans-serif; font-size: 12.96px; text-align: start; background-color: #ffffff;\"><span style=\"margin: 0px; padding: 0px; font-size: 14pt;\">Bảo quản nơi kh&ocirc; r&aacute;o, tr&aacute;nh &aacute;nh nắng trực tiếp.</span></p>\n<p style=\"margin: 0px; padding: 0px; color: #666666; font-family: Arial, Helvetica, sans-serif; font-size: 12.96px; text-align: start; background-color: #ffffff;\"><span style=\"margin: 0px; padding: 0px; font-size: 14pt;\">Kh&ocirc;ng sử dụng sản phẩm khi c&oacute; dấu diệu ẩm mốc, xuất hiện m&ugrave;i lạ.</span></p>\n<p style=\"margin: 0px; padding: 0px; color: #666666; font-family: Arial, Helvetica, sans-serif; font-size: 12.96px; text-align: start; background-color: #ffffff;\"></p>\n<p style=\"margin: 0px; padding: 0px; color: #666666; font-family: Arial, Helvetica, sans-serif; font-size: 12.96px; background-color: #ffffff; text-align: left;\"><em style=\"margin: 0px; padding: 0px;\"><strong style=\"margin: 0px; padding: 0px;\"><span style=\"margin: 0px; padding: 0px; font-size: 14pt;\">Sản phẩm được ph&acirc;n phối bởi Dala.vn.</span></strong></em></p>\n</div>', 35000, 32000, NULL, NULL, NULL, 3, 1, 1, 1, '', '', '', NULL, NULL, NULL, 80),
(4, 'Mứt hoa Atiso đỏ đặc biệt, ngon-150gr', 0, '2021-07-23 08:50:45', '4YE', 17, 0, 'https://appdala.net/wp-content/uploads/muthoaatisodo-1.jpg', 'https://appdala.net/wp-content/uploads/muthoaatisodo-2.jpg;https://appdala.net/wp-content/uploads/Hoa-Atiso-Do-4-1.png;https://appdala.net/wp-content/uploads/images-1-2.jpg', '', '<img style=\"display: block; margin-left: auto; margin-right: auto;\" src=\"https://appdala.net/wp-content/uploads/muthoaatisodo.jpg\" alt=\"\" width=\"300\" height=\"300\" />\n<p style=\"margin: 0px; padding: 0px; color: #666666; font-family: Arial, Helvetica, sans-serif; font-size: 12.96px; background-color: #ffffff;\"><span style=\"margin: 0px; padding: 0px; font-size: 12pt;\">Lo&agrave;i Hoa atiso đỏ rất gi&agrave;u dinh dưỡng, ngo&agrave;i ra hoa c&ograve;n chứa c&aacute;c axit v&agrave; protein, vitamin C c&ugrave;ng những chất c&oacute; t&iacute;nh kh&aacute;ng sinh kh&aacute;c. Hạt atiso đỏ chứa 7,6% nước, 22,3% dầu, 24% protein, 13,5% chất xơ v&agrave; 7% chất kho&aacute;ng.</span></p>\n<p style=\"margin: 0px; padding: 0px; color: #666666; font-family: Arial, Helvetica, sans-serif; font-size: 12.96px; background-color: #ffffff;\"><span style=\"margin: 0px; padding: 0px; font-size: 12pt;\">Theo một số nghi&ecirc;n cứu, trong th&agrave;nh phần dầu hạt hoa atiso đỏ c&oacute; t&aacute;c dụng chống nấm v&agrave; bệnh ngo&agrave;i da. Vitamin v&agrave; c&aacute;c chất b&eacute;o kh&ocirc;ng no c&oacute; trong n&oacute; cũng c&oacute; t&aacute;c dụng tốt đối với người cao tuổi v&agrave; người đang ăn ki&ecirc;ng. Hạt atiso đỏ chứa 7,6% nước, 22,3% dầu, 24% protein, 13,5% chất xơ v&agrave; 7% chất kho&aacute;ng.</span></p>\n<p style=\"margin: 0px; padding: 0px; color: #666666; font-family: Arial, Helvetica, sans-serif; font-size: 12.96px; background-color: #ffffff;\"><span style=\"margin: 0px; padding: 0px; font-size: 12pt;\"><br /><img style=\"display: block; margin-left: auto; margin-right: auto;\" src=\"https://appdala.net/wp-content/uploads/Hoa-Atiso-Do-4.png\" alt=\"\" width=\"300\" height=\"214\" /><br />Hoa atiso đỏ c&oacute; chứa một số chất c&oacute; t&iacute;nh kh&aacute;ng sinh, do đ&oacute; n&oacute; được d&acirc;n gian d&ugrave;ng như một phương thuốc thảo dược trị ho, vi&ecirc;m họng bằng c&aacute;ch lấy đ&agrave;i hoa atiso đỏ chưng lẫn đường ph&egrave;n, mật ong lấy nước uống v&agrave;i lần/ng&agrave;y. Sử dụng hoa atio đỏ thường xuy&ecirc;n cũng l&agrave; c&aacute;ch ngăn ngừa ho, cảm c&uacute;m.<br /><br /><br /><img style=\"display: block; margin-left: auto; margin-right: auto;\" src=\"https://appdala.net/wp-content/uploads/images-1-1.jpg\" alt=\"\" width=\"255\" height=\"198\" /></span></p>\n<div id=\"thong-tin-san-pham\" class=\"tab-pane fade in active\" style=\"margin: 0px; padding: 0px; color: #666666; font-family: Arial, Helvetica, sans-serif; font-size: 12.96px; background-color: #ffffff;\">\n<div class=\"entry-content\" style=\"margin: 0px; padding: 0px;\">\n<div id=\"themify_builder_content-440\" class=\"themify_builder_content themify_builder_content-440 themify_builder\" style=\"margin: 0px; padding: 0px; clear: both;\" data-postid=\"440\">\n<div class=\"themify_builder_row module_row clearfix module_row_0 themify_builder_440_row module_row_440-0 tb_htfy164\" style=\"margin: 0px; padding: 0px; position: relative; box-sizing: border-box; backface-visibility: hidden; transition: background 500ms ease 0s, font-size 0s ease 0s, line-height 0s ease 0s, color 0s ease 0s, padding 0s ease 0s, margin 0s ease 0s, border 0s ease 0s, border-radius 0s ease 0s, box-shadow 0s ease 0s, text-shadow 0s ease 0s, filter 0s ease 0s, -webkit-filter 0s ease 0s; width: 1150px;\">\n<div class=\"row_inner col_align_top\" style=\"margin: 0px; padding: 0px; position: relative; width: 1150px; box-sizing: border-box; display: flex; flex-flow: wrap;\">\n<div class=\"module_column tb-column col-full tb_440_column module_column_0 module_column_440-0-0 tb_19di168 last\" style=\"margin: 0px; padding: 0px; box-sizing: border-box; align-items: flex-start; align-content: flex-start; float: left; position: relative; clear: left; width: 1150px; transition: background 500ms ease 0s, font-size, line-height, color, padding, margin, border, border-radius, box-shadow, text-shadow, filter, -webkit-filter; display: flex; flex-flow: wrap;\">\n<div class=\"tb-column-inner\" style=\"margin: 0px; padding: 0px; position: relative; width: 1150px; box-sizing: border-box;\">\n<div class=\"module module-text text-440-0-0-0     tb_vy1e999\" style=\"margin: 0px; padding: 0px; box-sizing: border-box; transition: background 500ms ease 0s, font-size, line-height, color, padding, margin, border, border-radius, box-shadow, text-shadow, filter, -webkit-filter; position: relative;\">\n<div class=\"tb_text_wrap\" style=\"margin: 0px; padding: 0px;\">\n<p style=\"margin: 0px; padding: 0px;\"><span style=\"margin: 0px; padding: 0px; font-size: 12pt;\"><br />Atioso đỏ cũng chứa nhiều Bioflavonoids, một chất chống &ocirc; xy h&oacute;a ngăn cản qu&aacute; tr&igrave;nh &ocirc; xy h&oacute;a lipoprotein, gi&uacute;p hạ huyết &aacute;p. Nhiều người bị huyết &aacute;p cao thường uống tr&agrave; chế từ hoa atiso đỏ mỗi ng&agrave;y để giảm huyết &aacute;p.<br /></span></p>\n</div>\n</div>\n</div>\n</div>\n</div>\n</div>\n</div>\n</div>\n</div>\n<p style=\"margin: 0px; padding: 0px; color: #666666; font-family: Arial, Helvetica, sans-serif; font-size: 12.96px; background-color: #ffffff;\"></p>\n<div id=\"thong-so-ky-thuat\" class=\"tab-pane fade\" style=\"margin: 0px; padding: 0px; color: #666666; font-family: Arial, Helvetica, sans-serif; font-size: 12.96px; background-color: #ffffff;\">\n<h3 style=\"margin: 20px 0px 0.4em; padding: 0px; line-height: 1.4em; overflow-wrap: normal; font-size: 1.6em;\">Th&ocirc;ng số kỹ thuật</h3>\n<div style=\"margin: 0px; padding: 0px;\">\n<p style=\"margin: 0px; padding: 0px;\"><span style=\"margin: 0px; padding: 0px; font-size: 12pt;\">Chi tiết sản phẩm</span></p>\n<p style=\"margin: 0px; padding: 0px;\"><span style=\"margin: 0px; padding: 0px; font-size: 12pt;\">&ndash; Trọng lượng: 150gr</span></p>\n<p style=\"margin: 0px; padding: 0px;\"><span style=\"margin: 0px; padding: 0px; font-size: 12pt;\">&ndash; M&agrave;u sắc: m&agrave;u đỏ t&iacute;m của b&ocirc;ng tươi.</span></p>\n<p style=\"margin: 0px; padding: 0px;\"><span style=\"margin: 0px; padding: 0px; font-size: 12pt;\">&ndash; M&ugrave;i vị; gi&ograve;n, chua, ngọt, tốt cho sức khỏe &ndash; Sản phẩm cũng kh&ocirc;ng sử dụng chất bảo quản, chỉ sử dụng acid citrid đường v&agrave; muối của acid sorbid nhằm duy tr&igrave; m&agrave;u sắc v&agrave; hương vị sản phẩm, chỉ sử dụng được 3 th&aacute;ng. Sản phẩm ngon hơn nếu bỏ v&agrave;o tủ lạnh hoặc pha với nước cốt atiso đỏ c&ugrave;ng đ&aacute;, c&aacute;nh hoa gi&ograve;n c&ugrave;ng vị chua ngọt của nước cốt tạo n&ecirc;n thức uống tương tự cooktail</span></p>\n</div>\n</div>', 70000, 59000, NULL, NULL, NULL, 2, 1, 1, 1, '', '', '', NULL, NULL, NULL, 150),
(5, 'Kẹo dẻo phủ chocolate loại đặc biệt-220gr', 0, '2021-07-23 08:55:40', '57O', 17, 0, 'https://appdala.net/wp-content/uploads/Keodeo-4.jpg', 'https://appdala.net/wp-content/uploads/Keodeo-5.jpg;https://appdala.net/wp-content/uploads/keo-deo-chocolate-handmade-1504932104-1-4140608-1509593909-3.jpg;https://appdala.net/wp-content/uploads/keo-deo-phu-chocolate-handmade-1506263932-1-3898840-1506263932-2.jpg;https://appdala.net/wp-content/uploads/keo-deo-trai-cay-chocolate-handmade-1504949383-1-3791767-1504949383-2.jpg', '', '<h4 style=\"margin: 20px 0px 0.4em; padding: 0px; line-height: 1.4em; overflow-wrap: normal; font-size: 1.4em; color: #666666; font-family: Arial, Helvetica, sans-serif; background-color: #ffffff; text-align: center;\"><span style=\"margin: 0px; padding: 0px; font-size: 18pt;\">KẸO DẺO PHỦ SOCOLA &ndash; M&Oacute;N QU&Agrave; ĐẾN TỪ V&Ugrave;NG CAO NGUY&Ecirc;N Đ&Agrave; LẠT</span></h4>\n<h4 style=\"margin: 20px 0px 0.4em; padding: 0px; line-height: 1.4em; overflow-wrap: normal; font-size: 1.4em; color: #666666; font-family: Arial, Helvetica, sans-serif; background-color: #ffffff; text-align: center;\"><span style=\"margin: 0px; padding: 0px; font-size: 18pt;\"><br /><img src=\"https://appdala.net/wp-content/uploads/Keodeo-3.jpg\" alt=\"\" width=\"300\" height=\"300\" /><br /><br /></span></h4>\n<p style=\"margin: 0px; padding: 0px; font-size: 12.96px; font-weight: 400; text-align: start;\"><span style=\"margin: 0px; padding: 0px; font-size: 14pt;\">Kẹo dẻo phủ socola c&oacute; vị ngọt nhẹ v&agrave; dai, phủ một lớp socola mỏng, cho ta vị hậu đắng nhẹ tăng th&ecirc;m độ ho&agrave;n hảo v&agrave; một hương vị đặc trưng của v&ugrave;ng cao nguy&ecirc;n Đ&agrave; Lạt.</span></p>\n<ul style=\"margin: 1em 0px 1.4em 24px; padding: 0px; line-height: 18.144px; font-size: 12.96px; font-weight: 400; text-align: start;\">\n<li style=\"margin: 0px 0px 0.5em; padding: 0px;\"><span style=\"margin: 0px; padding: 0px; font-size: 14pt;\">M&agrave;u sắc: Kẹo c&oacute; m&agrave;u sắc tự nhi&ecirc;n, phủ b&ecirc;n tr&ecirc;n l&agrave; lớp socola mỏng tạo c&aacute;i nh&igrave;n thiện cảm cho người d&ugrave;ng.</span></li>\n<li style=\"margin: 0px 0px 0.5em; padding: 0px;\"><span style=\"margin: 0px; padding: 0px; font-size: 14pt;\">M&ugrave;i vị: mỗi m&agrave;u sắc l&agrave; một vị kh&aacute;c nhau, chua,ngọt trộn với vị hậu đắng nhẹ g&acirc;y k&iacute;ch th&iacute;ch vị gi&aacute;c.</span></li>\n<li style=\"margin: 0px 0px 0.5em; padding: 0px;\"><span style=\"margin: 0px; padding: 0px; font-size: 14pt;\">Ăn trực tiếp.</span></li>\n<li style=\"margin: 0px 0px 0.5em; padding: 0px;\"><span style=\"margin: 0px; padding: 0px; font-size: 14pt;\">Chỉ sử dụng acid citrid để bảo quản v&agrave; duy tr&igrave; m&agrave;u sắc cho sản phẩm. Trẻ em, phụ nữ mang thai c&oacute; thể sử dụng được.</span></li>\n</ul>\n<p style=\"margin: 0px; padding: 0px; font-size: 12.96px; font-weight: 400; text-align: start;\"><span style=\"margin: 0px; padding: 0px; font-size: 14pt;\"><strong style=\"margin: 0px; padding: 0px;\">&ndash; Th&agrave;nh phần</strong>: Kẹo dẻo tr&aacute;i c&acirc;y (70%), chocolate đen.</span></p>\n<p style=\"margin: 0px; padding: 0px; font-size: 12.96px; font-weight: 400; text-align: start;\"><span style=\"margin: 0px; padding: 0px; font-size: 14pt;\"><strong style=\"margin: 0px; padding: 0px;\">&ndash; KLT</strong>: 220g</span></p>\n<p style=\"margin: 0px; padding: 0px; font-size: 12.96px; font-weight: 400; text-align: start;\"><span style=\"margin: 0px; padding: 0px; font-size: 14pt;\"><strong style=\"margin: 0px; padding: 0px;\">&ndash; Hướng dẫn sử dụng</strong>: Mở bao b&igrave; v&agrave; d&ugrave;ng trực tiếp. L&agrave;m k&iacute;n miệng sau mỗi lần sử dụng.</span></p>\n<p style=\"margin: 0px; padding: 0px; font-size: 12.96px; font-weight: 400; text-align: start;\"><span style=\"margin: 0px; padding: 0px; font-size: 14pt;\"><strong style=\"margin: 0px; padding: 0px;\">&ndash; Bảo quản</strong>: Bảo quản nơi kh&ocirc; r&aacute;o tho&aacute;ng m&aacute;t, tr&aacute;nh &aacute;nh nắng trực tiếp.</span></p>\n<p style=\"margin: 0px; padding: 0px; font-size: 12.96px; font-weight: 400; text-align: start;\"><span style=\"margin: 0px; padding: 0px; font-size: 14pt;\">Kh&ocirc;ng sử dụng sản phẩm khi c&oacute; dấu hiệu ẩm mốc, xuất hiện m&ugrave;i lạ.</span></p>\n<p style=\"margin: 0px; padding: 0px; font-size: 12.96px; font-weight: 400; text-align: start;\"><span style=\"margin: 0px; padding: 0px; font-size: 14pt;\"><em style=\"margin: 0px; padding: 0px;\"><strong style=\"margin: 0px; padding: 0px;\">Sản phẩm được ph&acirc;n phối bởi Dala.vn.</strong></em></span></p>', 70000, 65000, NULL, NULL, NULL, 2, 1, 1, 1, '', '', '', NULL, NULL, NULL, 220),
(6, 'Mứt Chanh dây – 29gram', 0, '2021-07-23 08:58:37', '6MR', 17, 0, 'https://appdala.net/wp-content/uploads/mut-chanh-day-1-1.jpg', 'https://appdala.net/wp-content/uploads/2d829b44a905405b1914.jpg;https://appdala.net/wp-content/uploads/238.chanhday-1.jpg;https://appdala.net/wp-content/uploads/recipe13096-635845848321954266.jpg', '', '<img style=\"display: block; margin-left: auto; margin-right: auto;\" src=\"https://appdala.net/wp-content/uploads/2d829b44a905405b1914-1.jpg\" alt=\"\" width=\"300\" height=\"244\" /><span style=\"color: #666666; font-family: Arial, Helvetica, sans-serif; font-size: 12.96px; background-color: #ffffff;\"><span style=\"font-size: 12.96px;\">Chanh d&acirc;y l&agrave; một nguồn cung vitamin A dồi d&agrave;o, một dưỡng chất đặc biệt c&oacute; lợi gi&uacute;p l&agrave;m đẹp cho da. C&aacute;c chất chống oxy h&oacute;a kh&aacute;c trong chanh d&acirc;y như vitamin C, riboflavin v&agrave; carotene cũng gi&uacute;p tăng cường sức khỏe của da v&agrave; đẩy l&ugrave;i c&aacute;c dấu hiệu của l&atilde;o h&oacute;a.</span><br /><br /><img style=\"display: block; margin-left: auto; margin-right: auto;\" src=\"https://appdala.net/wp-content/uploads/174603_qua-chanh-leo-2-300x194-1.jpg\" alt=\"\" width=\"300\" height=\"194\" /><br /></span>\n<p style=\"margin: 0px; padding: 0px; color: #666666; font-family: Arial, Helvetica, sans-serif; font-size: 12.96px; background-color: #ffffff;\">Chanh d&acirc;y rất gi&agrave;u kali, một loại kho&aacute;ng chất quan trọng gi&uacute;p điều h&ograve;a huyết &aacute;p, l&agrave;m thư gi&atilde;n c&aacute;c mạch m&aacute;u v&agrave; tăng cường lưu lượng m&aacute;u. Qua đ&oacute; c&oacute; thể l&agrave;m giảm căng thẳng cho tim v&agrave; cải thiện sức khỏe tim to&agrave;n diện.</p>\n<p style=\"margin: 0px; padding: 0px; color: #666666; font-family: Arial, Helvetica, sans-serif; font-size: 12.96px; background-color: #ffffff;\">Chất flavonoid v&agrave; axit phenolic c&oacute; trong chanh d&acirc;y cũng c&oacute; thể gi&uacute;p kiểm so&aacute;t lượng cholesterol tốt hơn: tăng cholesterol tốt v&agrave; giảm cholesterol xấu g&acirc;y tắc nghẽn c&aacute;c động mạch, l&agrave;m suy yếu hoạt động của tim.</p>\n<p style=\"margin: 0px; padding: 0px; color: #666666; font-family: Arial, Helvetica, sans-serif; font-size: 12.96px; background-color: #ffffff;\"><br /><img style=\"display: block; margin-left: auto; margin-right: auto;\" src=\"https://appdala.net/wp-content/uploads/238.chanhday-1-1.jpg\" alt=\"\" width=\"300\" height=\"200\" /><br /><span style=\"font-size: 12.96px;\">Trong chanh d&acirc;y c&oacute; chứa rất nhiều chất chống oxy h&oacute;a gi&uacute;p chống lại c&aacute;c gốc tự do g&acirc;y ung thư. Chanh d&acirc;y cũng l&agrave; nguồn chứa vitamin A, flavonoid v&agrave; c&aacute;c hợp chất phenolic kh&aacute;c gi&uacute;p ngăn ngừa ung thư. Piceatannol, một hợp chất quan trọng kh&aacute;c được t&igrave;m thấy trong chanh d&acirc;y cũng c&oacute; thể hỗ trợ ti&ecirc;u diệt c&aacute;c tế b&agrave;o ung thư đại trực tr&agrave;ng.</span></p>', 20000, 15000, NULL, NULL, NULL, 4, 1, 1, 1, '', '', '', NULL, NULL, NULL, 29),
(7, 'Vỏ bưởi mật ong sấy dẻo-100gram', 0, '2021-07-23 09:55:40', '78', 17, 0, 'https://appdala.net/wp-content/uploads/vo-buoi-mat-ong.jpg', 'https://appdala.net/wp-content/uploads/vo-buoi-1-1.png;https://appdala.net/wp-content/uploads/vo-buoi-mat-ong-1.jpg;https://appdala.net/wp-content/uploads/vo-buoi-mat-ong-1-1.jpg;https://appdala.net/wp-content/uploads/vo-buoi-mat-ong-2.jpg;https://appdala.net/wp-content/uploads/vo-buoi-mat-ong-3.jpg', '', '', 70000, 65000, NULL, NULL, NULL, 1, 1, 1, 1, '', '', '', NULL, NULL, NULL, 100),
