(9, 'Chuối Laba sấy dẻo (Soft dried banana) – 250gr', 0, '2021-07-23 10:00:34', '9WR', 17, 0, 'https://appdala.net/wp-content/uploads/chuoideo.png', 'https://appdala.net/wp-content/uploads/1a96691e84bb5231e72caac6bf0f581f.jpg;https://appdala.net/wp-content/uploads/chuoideo-1.png;https://appdala.net/wp-content/uploads/chuoi-say-deo.jpg;https://appdala.net/wp-content/uploads/chuoi-say-deo-dac-biet-trai-cay-hat-say-com-1.jpg', '', '<span style=\"color: #666666; font-family: Arial, Helvetica, sans-serif; font-size: 12.96px; background-color: #ffffff;\"><span style=\"font-size: 12.96px;\">Chuối kh&ocirc; sấy dẻo c&oacute; nhiều vi chất dinh dưỡng bảo vệ hệ miễn dịch v&agrave; ngăn ngừa hiệu quả c&aacute;c bệnh m&atilde;n t&iacute;nh. Mỗi ng&agrave;y, người c&oacute; thể trạng b&igrave;nh thường v&agrave; sức khỏe ổn định n&ecirc;n ăn 1-2 quả chuối tươi hay tương đương với 50g chuối kh&ocirc; sấy dẻo để chăm s&oacute;c v&agrave; bảo vệ tốt nhất cho sức khỏe của ch&iacute;nh m&igrave;nh.<br /></span><br /><img style=\"display: block; margin-left: auto; margin-right: auto;\" src=\"https://appdala.net/wp-content/uploads/1a96691e84bb5231e72caac6bf0f581f-1.jpg\" alt=\"\" width=\"300\" height=\"300\" /><br /></span>\n<div style=\"margin: 0px; padding: 0px; color: #666666; font-family: Arial, Helvetica, sans-serif; font-size: 12.96px; background-color: #ffffff;\">\n<div style=\"margin: 0px; padding: 0px; color: #666666; font-family: Arial, Helvetica, sans-serif; font-size: 12.96px; background-color: #ffffff;\"><strong style=\"margin: 0px; padding: 0px;\">Người hay bị t&aacute;o b&oacute;n hoặc rối loạn ti&ecirc;u h&oacute;a</strong>:chất xơ c&oacute; trong chuối sấy c&oacute; t&aacute;c dụng nhuận tr&agrave;ng, giảm t&aacute;o b&oacute;n. Chất pectin c&oacute; trong chuối sấy dẻo c&oacute; thể hỗ trợ l&agrave;m giảm rối loạn đường ruột g&acirc;y ti&ecirc;u chảy.</div>\n<p style=\"margin: 0px; padding: 0px; color: #666666; font-family: Arial, Helvetica, sans-serif; font-size: 12.96px; background-color: #ffffff;\"><strong style=\"margin: 0px; padding: 0px;\">*Người hay l&agrave;m việc tr&iacute; &oacute;c, hay căng thẳng, đang stress</strong>:<em style=\"margin: 0px; padding: 0px;\">Vi</em>chất kali gi&uacute;p tr&iacute; n&atilde;o hoạt động linh hoạt hơn, thư gi&atilde;n tinh thần, giảm t&igrave;nh trạng căng thẳng g&acirc;y stress vật l&yacute;.</p>\n<p style=\"margin: 0px; padding: 0px; color: #666666; font-family: Arial, Helvetica, sans-serif; font-size: 12.96px; background-color: #ffffff;\"><strong style=\"margin: 0px; padding: 0px;\">*Người hay bị tụt đường huyết</strong>:chất sắt c&oacute; trong chuối sấy dẻo gi&uacute;p cơ thể tr&aacute;nh được nguy cơ thiếu m&aacute;u do thiếu sắt.<br style=\"margin: 0px; padding: 0px;\" /><strong style=\"margin: 0px; padding: 0px;\">*Người muốn tăng c&acirc;n</strong>:việc bổ sung th&ecirc;m chuối sấy dẻo sau mỗi bữa ăn c&oacute; t&aacute;c dụng t&iacute;ch cực l&ecirc;n hệ ti&ecirc;u h&oacute;a, gi&uacute;p ăn ngon hơn, ti&ecirc;u h&oacute;a thức ăn tốt hơn, hấp thụ dinh dưỡng tốt hơn n&ecirc;n gi&uacute;p tăng c&acirc;n tự nhi&ecirc;n c&oacute; kiểm so&aacute;t.<br /><br /></p>\n</div>\n<p style=\"margin: 0px; padding: 0px; color: #666666; font-family: Arial, Helvetica, sans-serif; font-size: 12.96px; background-color: #ffffff;\"><br /><img style=\"display: block; margin-left: auto; margin-right: auto;\" src=\"https://appdala.net/wp-content/uploads/chuoideo-2.png\" alt=\"\" width=\"300\" height=\"300\" /><br /><br /></p>\n<p style=\"margin: 0px; padding: 0px; color: #666666; font-family: Arial, Helvetica, sans-serif; font-size: 12.96px; background-color: #ffffff;\"><strong style=\"margin: 0px; padding: 0px;\">Lưu &yacute; một số bệnh nh&acirc;n kh&ocirc;ng n&ecirc;n ăn chuối sấy?</strong></p>\n<p style=\"margin: 0px; padding: 0px; color: #666666; font-family: Arial, Helvetica, sans-serif; font-size: 12.96px; background-color: #ffffff;\">Ăn chuối kh&ocirc; sấy dẻo c&oacute; thể ảnh hưởng kh&ocirc;ng tốt đến sức khỏe cho những người bị bệnh m&atilde;n t&iacute;nh sau:</p>\n<p style=\"margin: 0px; padding: 0px; color: #666666; font-family: Arial, Helvetica, sans-serif; font-size: 12.96px; background-color: #ffffff;\"><strong style=\"margin: 0px; padding: 0px;\">*</strong><em style=\"margin: 0px; padding: 0px;\">Người bị suy thận, vi&ecirc;m cầu thận</em>: nồng độ kali trong m&aacute;u sẽ tăng khi ăn chuối, g&acirc;y ra triệu chứng bất lợi cho sức khỏe như rối loạn nhịp tim, buồn n&ocirc;n, hồi hộp.</p>\n<p style=\"margin: 0px; padding: 0px; color: #666666; font-family: Arial, Helvetica, sans-serif; font-size: 12.96px; background-color: #ffffff;\"><strong style=\"margin: 0px; padding: 0px;\">*</strong><em style=\"margin: 0px; padding: 0px;\">Những người đang bị đau đầu</em>: chất tyramine, phenyethyamine v&agrave; axit amin trong chuối c&oacute; thể l&agrave;m gi&atilde;n mạch m&aacute;u khiến cơn đau đầu trở n&ecirc;n nghi&ecirc;m trọng hơn.<br style=\"margin: 0px; padding: 0px;\" /><strong style=\"margin: 0px; padding: 0px;\">*</strong><em style=\"margin: 0px; padding: 0px;\">Người bị tiểu đường</em>: khi ăn chuối sẽ bổ sung lượng đường c&oacute; thể g&acirc;y hại cho người bị rối loạn chuyển h&oacute;a.<br /><br /></p>\n<h3 style=\"margin: 20px 0px 0.4em; padding: 0px; line-height: 1.4em; overflow-wrap: normal; font-size: 1.6em; color: #666666; font-family: Arial, Helvetica, sans-serif; background-color: #ffffff;\">Th&ocirc;ng số kỹ thuật</h3>\n<div style=\"margin: 0px; padding: 0px; color: #666666; font-family: Arial, Helvetica, sans-serif; font-size: 12.96px; background-color: #ffffff;\">\n<div class=\" _50f7\" style=\"margin: 0px; padding: 0px;\">Chi tiết sản phẩm:</div>\n<div style=\"margin: 0px; padding: 0px;\">&ndash; Trọng lượng: 250gr</div>\n<div class=\"_1xwp\" style=\"margin: 0px; padding: 0px;\">&ndash; M&agrave;u sắc: M&agrave;u v&agrave;ng hoặc hơi n&acirc;u<br style=\"margin: 0px; padding: 0px;\" />&ndash; M&ugrave;i vị: do sấy ở nhiệt độ thấp n&ecirc;n mật được h&uacute;t v&agrave;o b&ecirc;n trong tạo độ dẻo l&acirc;u d&agrave;i v&agrave; vị ngọt thanh tự nhi&ecirc;n.<br style=\"margin: 0px; padding: 0px;\" />&ndash; Việc đ&oacute;ng g&oacute;i h&uacute;t ch&acirc;n kh&ocirc;ng ngăn sản phẩm kh&ocirc;ng tiếp x&uacute;c với kh&ocirc;ng kh&iacute; n&ecirc;n sản phẩm kh&ocirc;ng bị kh&ocirc; theo thời gian. Tuy nhi&ecirc;n, khi để l&acirc;u 1 thời gian, sản phẩm sẽ bị xuống m&agrave;u (chuyển n&acirc;u) đ&acirc;y l&agrave; một chu tr&igrave;nh b&igrave;nh thường của sản phẩm do hệ m&agrave;u bị ph&aacute; hủy khi sản phẩm tiếp x&uacute;c với &aacute;nh s&aacute;ng. Sản phẩm vẫn sử dụng được b&igrave;nh thường cho đến khi hết hạn sử dụng.<br style=\"margin: 0px; padding: 0px;\" />&ndash; Kh&ocirc;ng sử dụng chất bảo quản, trẻ nhỏ, phụ nữ mang thai v&agrave; người ăn chay đều c&oacute; thể sử dụng được</div>\n</div>', 60000, 55000, NULL, NULL, NULL, 2, 1, 1, 1, '', '', '', NULL, NULL, NULL, 250),
(10, 'Dâu tây sấy dẻo-150gr', 0, '2021-07-23 10:08:28', '105', 17, 0, 'https://appdala.net/wp-content/uploads/Dautay-1-1.jpg', 'https://appdala.net/wp-content/uploads/Dau-tay-da-lat-say-deo-2-1.png;https://appdala.net/wp-content/uploads/Dautay-1-2.jpg;https://appdala.net/wp-content/uploads/14650111_1834506056785453_4163471559046559578_n-1.jpg', '', '<span style=\"color: #666666; font-family: Arial, Helvetica, sans-serif; font-size: 12.96px; background-color: #ffffff;\"><img style=\"display: block; margin-left: auto; margin-right: auto;\" src=\"https://appdala.net/wp-content/uploads/Dau-tay-da-lat-say-deo-2.png\" alt=\"\" width=\"300\" height=\"264\" /><br /><span style=\"font-size: 12.96px;\">Từ l&acirc;u, những quả d&acirc;u t&acirc;y đỏ mọng nước đã n&ocirc;̉i ti&ecirc;́ng là ngu&ocirc;̀n cung c&acirc;́p vitamin C d&ocirc;̀i dào cho cơ th&ecirc;̉, nhưng ít người bi&ecirc;́t tới loại quả này còn r&acirc;́t giàu các ch&acirc;́t ch&ocirc;́ng oxy hóa có lợi. Vi&ecirc;̣c ăn d&acirc;u t&acirc;y m&ocirc;̃i ngày giúp ngăn ngừa lão hóa, tăng cường h&ecirc;̣ mi&ecirc;̃n dịch, giảm chứng vi&ecirc;m khớp, phòng ngừa ti&ecirc;̉u đường cũng như sự hình thành và lan r&ocirc;̣ng của các kh&ocirc;́i u. Đặc bi&ecirc;̣t, d&acirc;u t&acirc;y còn giúp cơ th&ecirc;̉ sản sinh các hormore hạnh phúc (dopamine, serotonin) kh&ocirc;ng chỉ chữa chứng tr&acirc;̀m cảm còn giúp thúc đ&acirc;̉y máu mang dưỡng ch&acirc;́t tới não.</span><br /><br /><img style=\"display: block; margin-left: auto; margin-right: auto;\" src=\"https://appdala.net/wp-content/uploads/14650111_1834506056785453_4163471559046559578_n.jpg\" alt=\"\" width=\"300\" height=\"200\" /><br /></span><span style=\"color: #666666; font-family: Arial, Helvetica, sans-serif; font-size: 12.96px; background-color: #ffffff;\"><span style=\"color: #666666; font-family: Arial, Helvetica, sans-serif; font-size: 12.96px; background-color: #ffffff;\">Hi&ecirc;̉u được được t&acirc;̀m quan trọng của d&acirc;u t&acirc;y đ&ocirc;́i với sức khỏe,</span><strong style=\"margin: 0px; padding: 0px; color: #666666; font-family: Arial, Helvetica, sans-serif; font-size: 12.96px; background-color: #ffffff;\">BerryLand</strong><span style=\"color: #666666; font-family: Arial, Helvetica, sans-serif; font-size: 12.96px; background-color: #ffffff;\">đã sử dụng d&acirc;y chuy&ecirc;̀n sản xu&acirc;́t hi&ecirc;̣n đại của mình đ&ecirc;̉ mang đ&ecirc;́n những quả d&acirc;u c&ocirc; đặc đ&acirc;̀y dinh dưỡng trong món</span><strong style=\"margin: 0px; padding: 0px; color: #666666; font-family: Arial, Helvetica, sans-serif; font-size: 12.96px; background-color: #ffffff;\">D&acirc;u S&acirc;́y Dẻo</strong><span style=\"color: #666666; font-family: Arial, Helvetica, sans-serif; font-size: 12.96px; background-color: #ffffff;\">n&ocirc;̉i ti&ecirc;́ng của mình. Được s&acirc;́y bằng c&ocirc;ng ngh&ecirc;̣ cao trong d&acirc;y chuy&ecirc;̀n khép kín,</span><strong style=\"margin: 0px; padding: 0px; color: #666666; font-family: Arial, Helvetica, sans-serif; font-size: 12.96px; background-color: #ffffff;\">D&acirc;u s&acirc;́y dẻo<strong style=\"margin: 0px; padding: 0px;\">BerryLand</strong></strong><span style=\"color: #666666; font-family: Arial, Helvetica, sans-serif; font-size: 12.96px; background-color: #ffffff;\">kh&ocirc;ng chỉ giữ được hàm lượng dinh dưỡng của trái c&acirc;y tươi, mà còn làm giảm đ&ocirc;̣ chua giúp tăng vị ngọt dịu cho những quả d&acirc;u th&ecirc;m ph&acirc;̀n thơm ngon. Chính vì v&acirc;̣y, món ăn vặt dinh dưỡng này sẽ là lựa chọn phù hợp cho t&acirc;́t cả các đ&ocirc;́i tượng từ trẻ em, người lớn cho tới các mẹ b&acirc;̀u. Ngoài ra, sản ph&acirc;̉m được đóng gói nhỏ gọn, đẹp mắt phù hợp cho vi&ecirc;̣c đãi khách, mang theo tới văn phòng, hay những chuy&ecirc;́n du lịch xa.</span><br /><br /><img style=\"display: block; margin-left: auto; margin-right: auto;\" src=\"https://appdala.net/wp-content/uploads/Dautay-1.jpg\" alt=\"\" width=\"300\" height=\"300\" /><br /></span>\n<div id=\"thong-tin-san-pham\" class=\"tab-pane fade in active\" style=\"margin: 0px; padding: 0px; color: #666666; font-family: Arial, Helvetica, sans-serif; font-size: 12.96px; background-color: #ffffff;\">\n<div class=\"entry-content\" style=\"margin: 0px; padding: 0px;\">\n<div id=\"themify_builder_content-445\" class=\"themify_builder_content themify_builder_content-445 themify_builder\" style=\"margin: 0px; padding: 0px; clear: both;\" data-postid=\"445\">\n<div class=\"themify_builder_row module_row clearfix module_row_0 themify_builder_445_row module_row_445-0 tb_gao3585\" style=\"margin: 0px; padding: 0px; position: relative; box-sizing: border-box; transition: background 500ms ease 0s, font-size 0s ease 0s, line-height 0s ease 0s, color 0s ease 0s, padding 0s ease 0s, margin 0s ease 0s, border 0s ease 0s, border-radius 0s ease 0s, box-shadow 0s ease 0s, text-shadow 0s ease 0s, filter 0s ease 0s, -webkit-filter 0s ease 0s; width: 1150px;\">\n<div class=\"row_inner col_align_top\" style=\"margin: 0px; padding: 0px; position: relative; width: 1150px; box-sizing: border-box; display: flex; flex-flow: wrap;\">\n<div class=\"module_column tb-column col-full tb_445_column module_column_0 module_column_445-0-0 tb_zaf9586 last\" style=\"margin: 0px; padding: 0px; box-sizing: border-box; align-items: flex-start; align-content: flex-start; float: left; position: relative; clear: left; width: 1150px; transition: background 500ms ease 0s, font-size, line-height, color, padding, margin, border, border-radius, box-shadow, text-shadow, filter, -webkit-filter; display: flex; flex-flow: wrap;\">\n<div class=\"tb-column-inner\" style=\"margin: 0px; padding: 0px; position: relative; width: 1150px; box-sizing: border-box;\">\n<div class=\"module module-text text-445-0-0-0     tb_7ptl531\" style=\"margin: 0px; padding: 0px; box-sizing: border-box; transition: background 500ms ease 0s, font-size, line-height, color, padding, margin, border, border-radius, box-shadow, text-shadow, filter, -webkit-filter; position: relative;\">\n<div class=\"tb_text_wrap\" style=\"margin: 0px; padding: 0px;\">\n<ul style=\"margin: 1em 0px 1.4em 24px; padding: 0px; line-height: 18.144px;\">\n<li style=\"margin: 0px 0px 0.5em; padding: 0px;\">\n<div id=\"thong-tin-san-pham\" class=\"tab-pane fade in active\" style=\"margin: 0px; padding: 0px; color: #666666; font-family: Arial, Helvetica, sans-serif; font-size: 12.96px; background-color: #ffffff;\">\n<div class=\"entry-content\" style=\"margin: 0px; padding: 0px;\">\n<div id=\"themify_builder_content-445\" class=\"themify_builder_content themify_builder_content-445 themify_builder\" style=\"margin: 0px; padding: 0px; clear: both;\" data-postid=\"445\">\n<div class=\"themify_builder_row module_row clearfix module_row_0 themify_builder_445_row module_row_445-0 tb_gao3585\" style=\"margin: 0px; padding: 0px; position: relative; box-sizing: border-box; transition: background 500ms ease 0s, font-size 0s ease 0s, line-height 0s ease 0s, color 0s ease 0s, padding 0s ease 0s, margin 0s ease 0s, border 0s ease 0s, border-radius 0s ease 0s, box-shadow 0s ease 0s, text-shadow 0s ease 0s, filter 0s ease 0s, -webkit-filter 0s ease 0s; width: 1150px;\">\n<div class=\"row_inner col_align_top\" style=\"margin: 0px; padding: 0px; position: relative; width: 1150px; box-sizing: border-box; display: flex; flex-flow: wrap;\">\n<div class=\"module_column tb-column col-full tb_445_column module_column_0 module_column_445-0-0 tb_zaf9586 last\" style=\"margin: 0px; padding: 0px; box-sizing: border-box; align-items: flex-start; align-content: flex-start; float: left; position: relative; clear: left; width: 1150px; transition: background 500ms ease 0s, font-size, line-height, color, padding, margin, border, border-radius, box-shadow, text-shadow, filter, -webkit-filter; display: flex; flex-flow: wrap;\">\n<div class=\"tb-column-inner\" style=\"margin: 0px; padding: 0px; position: relative; width: 1150px; box-sizing: border-box;\">\n<div class=\"module module-text text-445-0-0-0     tb_7ptl531\" style=\"margin: 0px; padding: 0px; box-sizing: border-box; transition: background 500ms ease 0s, font-size, line-height, color, padding, margin, border, border-radius, box-shadow, text-shadow, filter, -webkit-filter; position: relative;\">\n<div class=\"tb_text_wrap\" style=\"margin: 0px; padding: 0px;\">\n<ul style=\"margin: 1em 0px 1.4em 24px; padding: 0px; line-height: 18.144px;\">\n<li style=\"margin: 0px 0px 0.5em; padding: 0px;\">Nguy&ecirc;n liệu ch&iacute;nh: d&acirc;u t&acirc;y tươi.</li>\n<li style=\"margin: 0px 0px 0.5em; padding: 0px;\">Sản ph&acirc;̉m được sơ chế v&agrave; sấy bằng c&ocirc;ng nghệ hiện đại, kh&eacute;p k&iacute;n, đảm bảo đạt chuẩn an to&agrave;n vệ sinh thực phẩm.</li>\n<li style=\"margin: 0px 0px 0.5em; padding: 0px;\">L&agrave; một sản phẩm c&ocirc; đặc của tr&aacute;i c&acirc;y tươi, vẫn giữ được hương vị thơm ngon, m&agrave;u sắc kh&ocirc;ng kh&ocirc; cứng.</li>\n<li style=\"margin: 0px 0px 0.5em; padding: 0px;\">Sản phẩm kh&ocirc;ng qua chi&ecirc;n dầu n&ecirc;n kh&ocirc;ng bị hiện tượng thấm dầu v&agrave; h&ocirc;i dầu.</li>\n<li style=\"margin: 0px 0px 0.5em; padding: 0px;\">Sản phẩm vẫn giữ được c&aacute;c yếu tố như m&agrave;u sắc, th&agrave;nh phần dinh dưỡng, vitamin v&agrave; đặc t&iacute;nh đặc trưng ri&ecirc;ng của từng loại tr&aacute;i c&acirc;y.</li>\n<li style=\"margin: 0px 0px 0.5em; padding: 0px;\">Bảo quản được l&acirc;u hơn so với tr&aacute;i c&acirc;y tươi v&agrave; l&agrave; bữa ăn nhẹ tiện dụng cho những chuyến đi chơi d&agrave;i.</li>\n</ul>\n<p style=\"margin: 0px; padding: 0px;\"><strong style=\"margin: 0px; padding: 0px;\">Hướng dẫn bảo quản</strong></p>\n<ul style=\"margin: 1em 0px 1.4em 24px; padding: 0px; line-height: 18.144px;\">\n<li style=\"margin: 0px 0px 0.5em; padding: 0px;\">Đ&oacute;ng k&iacute;n bao b&igrave; để giữ kh&ocirc; r&aacute;o sản phẩm sau khi sử dụng.</li>\n<li style=\"margin: 0px 0px 0.5em; padding: 0px;\">Bảo quản nơi tho&aacute;ng m&aacute;t, tr&aacute;nh &aacute;nh nắng trực tiếp.</li>\n<li style=\"margin: 0px 0px 0.5em; padding: 0px;\">Bảo quản được l&acirc;u hơn so với tr&aacute;i c&acirc;y tươi v&agrave; l&agrave; bữa ăn nhẹ tiện dụng cho những chuyến đi chơi d&agrave;i.</li>\n</ul>\n<p style=\"margin: 0px; padding: 0px;\"></p>\n<p style=\"margin: 0px; padding: 0px;\"></p>\n</div>\n</div>\n</div>\n</div>\n</div>\n</div>\n</div>\n</div>\n</div>\n<div id=\"thong-so-ky-thuat\" class=\"tab-pane fade\" style=\"margin: 0px; padding: 0px; color: #666666; font-family: Arial, Helvetica, sans-serif; font-size: 12.96px; background-color: #ffffff;\">\n<h3 style=\"margin: 20px 0px 0.4em; padding: 0px; line-height: 1.4em; overflow-wrap: normal; font-size: 1.6em;\">Th&ocirc;ng số kỹ thuật</h3>\n<div style=\"margin: 0px; padding: 0px;\">\n<div class=\" _50f7\" style=\"margin: 0px; padding: 0px;\">Chi tiết sản phẩm:</div>\n<div style=\"margin: 0px; padding: 0px;\">&ndash; Trọng lượng: 150gr</div>\n<div class=\"_1xwp\" style=\"margin: 0px; padding: 0px;\">&ndash; M&agrave;u sắc: m&agrave;u đỏ tự nhi&ecirc;n<br style=\"margin: 0px; padding: 0px;\" />&ndash; M&ugrave;i vị: vị d&acirc;u tự nhi&ecirc;n, chua chua ngọt ngọt<br style=\"margin: 0px; padding: 0px;\" />&ndash; Kh&ocirc;ng sử dụng chất bảo quản, trẻ nhỏ, phụ nữ mang thai v&agrave; người ăn chay đều c&oacute; thể sử dụng được<br style=\"margin: 0px; padding: 0px;\" />&ndash; Rất ngon khi d&ugrave;ng k&egrave;m sữa chua.</div>\n</div>\n</div>\n</li>\n</ul>\n</div>\n</div>\n</div>\n</div>\n</div>\n</div>\n</div>\n</div>\n</div>\n<span style=\"color: #666666; font-family: Arial, Helvetica, sans-serif; font-size: 12.96px; background-color: #ffffff;\"><br /></span>', 140000, 120000, NULL, NULL, NULL, 2, 1, 1, 1, '', '', '', NULL, NULL, NULL, 150),
(11, 'Chuối Laba sấy dòn loại Đặc Biệt-100gram', 0, '2021-07-23 10:20:41', '11UJ', 17, 0, 'https://appdala.net/wp-content/uploads/hinh-say-gion.jpg', 'https://appdala.net/wp-content/uploads/hinh-mat-truoc.jpg;https://appdala.net/wp-content/uploads/hinh-chuoi.jpg;https://appdala.net/wp-content/uploads/hinh-say-gion-1.jpg', '', '<span style=\"color: #666666; font-family: Arial, Helvetica, sans-serif; font-size: 18.6667px; background-color: #ffffff;\"><span style=\"font-size: 18.6667px;\">Trong mỗi quả chuối c&oacute; lượng vitamin A, C c&oacute; khả năng tăng cường, cải thiện sức khỏe cho mắt. B&ecirc;n cạnh đ&oacute; th&agrave;nh phần beta carotene, lutein, ngo&agrave;i ra vitamin E của chuối c&ograve;n c&oacute; t&aacute;c dụng gi&uacute;p ph&ograve;ng tr&aacute;nh t&igrave;nh trạng oxy h&oacute;a ở mắt, chống hiện tượng tho&aacute;i h&oacute;a điểm v&agrave;ng. Do đ&oacute;, bạn n&ecirc;n bổ sung loại thực phẩm n&agrave;y cho trẻ nhỏ từ sớm để b&eacute; c&oacute; đ&ocirc;i mắt s&aacute;ng khỏe.</span><br /><img style=\"display: block; margin-left: auto; margin-right: auto;\" src=\"https://appdala.net/wp-content/uploads/hinh-chuoi-1.jpg\" alt=\"\" width=\"300\" height=\"300\" /><br /></span><span style=\"margin: 0px; padding: 0px; color: #666666; font-family: Arial, Helvetica, sans-serif; background-color: #ffffff; font-size: 14pt;\"><span style=\"margin: 0px; padding: 0px; color: #666666; font-family: Arial, Helvetica, sans-serif; background-color: #ffffff; font-size: 14pt;\">Chuối sấy gi&ograve;n của dalat chips l&agrave; m&oacute;n ăn đặc sản Đ&agrave; Lạt được chế biến bằng c&ocirc;ng nghệ hiện đại: kh&ocirc;ng sử dụng phẩm m&agrave;u, kh&ocirc;ng đường, kh&ocirc;ng chất bảo quản v&agrave; kh&ocirc;ng chứa cholesterol n&ecirc;n chuối sấy của dalat chips vẫn giữ được đặc t&iacute;nh tự nhi&ecirc;n.</span><br style=\"margin: 0px; padding: 0px; color: #666666; font-family: Arial, Helvetica, sans-serif; font-size: 12.96px; background-color: #ffffff;\" /><span style=