(12, 'Trà Actisô Túi Lọc Ladophar – 100 túi', 0, '2021-07-23 10:23:21', '12OL', 17, 0, 'https://appdala.net/wp-content/uploads/tui-loc-1-1.jpg', 'https://appdala.net/wp-content/uploads/tui-loc-1-2.jpg;https://appdala.net/wp-content/uploads/tui-loc-2.jpg;https://appdala.net/wp-content/uploads/tui-loc-3.jpg;https://appdala.net/wp-content/uploads/tui-loc-4.jpg', '', '<img style=\"display: block; margin-left: auto; margin-right: auto;\" src=\"https://appdala.net/wp-content/uploads/tui-loc-1.jpg\" alt=\"\" width=\"300\" height=\"300\" />\n<p style=\"margin: 0px; padding: 0px; color: #666666; font-family: Arial, Helvetica, sans-serif; font-size: 12.96px; background-color: #ffffff;\"><span style=\"margin: 0px; padding: 0px; font-size: 14pt;\">Tr&agrave; t&uacute;i lọc Actiso l&agrave; sản phấm chiết xuất từ thi&ecirc;n nhi&ecirc;n, với hương thơm v&agrave; vị ngọt ho&agrave;n to&agrave;n tự nhi&ecirc;n nay được bổ sung th&ecirc;m th&agrave;nh phần cao Actis&ocirc; gi&uacute;p tăng cường hiệu quả ph&ograve;ng ngừa v&agrave; bảo vệ gan mật.</span></p>\n<p style=\"margin: 0px; padding: 0px; color: #666666; font-family: Arial, Helvetica, sans-serif; font-size: 12.96px; background-color: #ffffff;\"><span style=\"margin: 0px; padding: 0px; font-size: 14pt;\">Tr&agrave; t&uacute;i lọc Actiso được đ&oacute;ng g&oacute;i theo quy c&aacute;ch 100 t&uacute;i lọc x 2g, rất dễ d&agrave;ng sử dụng cũng như bảo quản.</span></p>\n<p style=\"margin: 0px; padding: 0px; color: #666666; font-family: Arial, Helvetica, sans-serif; font-size: 12.96px; background-color: #ffffff;\"><span style=\"margin: 0px; padding: 0px; font-size: 14pt;\">Tr&agrave; t&uacute;i lọc Actiso rất tốt. Với c&ocirc;ng dụng m&aacute;t gan, lợi tiểu, th&ocirc;ng mật, rất th&iacute;ch hợp cho người bị yếu gan, nổi mề đay, v&agrave;ng da. C&oacute; thể d&ugrave;ng hằng ng&agrave;y thay nước lọc.</span></p>\n<p style=\"margin: 0px; padding: 0px; color: #666666; font-family: Arial, Helvetica, sans-serif; font-size: 12.96px; 