(13, 'Cao Đặc Actiso Ladophar – 100g', 0, '2021-07-23 10:25:10', '13PU', 17, 0, 'https://appdala.net/wp-content/uploads/cao-dac-3.jpg', 'https://appdala.net/wp-content/uploads/cao-dac-1.jpg;https://appdala.net/wp-content/uploads/cao-dac-2.jpg;https://appdala.net/wp-content/uploads/cao-dac-3-1.jpg', '', '<h1 style=\"margin: 20px 0px 0.4em; padding: 0px; line-height: 1.4em; overflow-wrap: normal; color: #666666; font-family: Arial, Helvetica, sans-serif; background-color: #ffffff;\">Cao Đặc Actiso 100g</h1>\n<div id=\"themify_builder_content-2279\" class=\"themify_builder_content themify_builder_content-2279 themify_builder\" style=\"margin: 0px; padding: 0px; clear: both; color: #666666; font-family: Arial, Helvetica, sans-serif; font-size: 12.96px; background-color: #ffffff;\" data-postid=\"2279\">\n<div class=\"themify_builder_row module_row clearfix module_row_0 themify_builder_2279_row module_row_2279-0 tb_w0sc587\" style=\"margin: 0px; padding: 0px; position: relative; box-sizing: border-box; width: 1150px;\">\n<div class=\"row_inner col_align_top\" style=\"margin: 0px; padding: 0px; position: relative; width: 1150px; box-sizing: border-box; display: flex; flex-flow: wrap;\">\n<div class=\"module_column tb-column col-full tb_2279_column module_column_0 module_column_2279-0-0 tb_zugn589 last\" style=\"margin: 0px; padding: 0px; box-sizing: border-box; align-items: flex-start; align-content: flex-start; float: left; position: relative; clear: left; width: 1150px; display: flex; flex-flow: wrap;\">\n<div class=\"tb-column-inner\" style=\"margin: 0px; padding: 0px; position: relative; width: 1150px; box-sizing: border-box;\">\n<div class=\"module module-text text-2279-0-0-0     tb_hn1j634\" style=\"margin: 0px; padding: 0px; box-sizing: border-box; transition: background 500ms ease 0s, font-size, line-height, color, padding, margin, border, border-radius, box-shadow, text-shadow, filter, -webkit-filter; position: relative;\">\n<div class=\"tb_text_wrap\" style=\"margin: 0px; padding: 0px;\">\n<p style=\"margin: 0px; padding: 0px;\"><strong style=\"margin: 0px; padding: 0px;\">Cao đặc Actis&ocirc;</strong>l&agrave; sản phẩm chiết xuất tinh chất của Actis&ocirc; với c&ocirc;ng nghệ c&ocirc; cao ch&acirc;n kh&ocirc;ng hiện đại v&agrave; được xử l&yacute; theo quy tr&igrave;nh 24h của Ladophar gi&uacute;p giữ to&agrave;n vẹn h&agrave;m lượng hoạt chất Cynarin.</p>\n<p style=\"margin: 0px; padding: 0px;\">100g cao đặc LADOactiso từ Ladophar tương đương 3.500g l&aacute; tươi Atis&ocirc;</p>\n<p style=\"margin: 0px; padding: 0px;\">Ladophar tự h&agrave;o l&agrave; đơn vị đầu ti&ecirc;n nghi&ecirc;n cứu v&agrave; sản xuất ra cao Actis&ocirc; tại Việt Nam với h&agrave;m lượng hoạt chất cao nhất thị trường.</p>\n<p style=\"margin: 0px; padding: 0px;\">Cao Actis&ocirc; l&agrave; hoạt chất to&agrave;n phần chiết xuất từ l&aacute; tươi Actis&ocirc;, bằng c&ocirc;ng nghệ c&ocirc; ch&acirc;n kh&ocirc;ng, bảo to&agrave;n h&agrave;m lượng hoạt chất.</p>\n<p style=\"margin: 0px; padding: 0px;\"><strong style=\"margin: 0px; padding: 0px;\">Th&agrave;nh phần:</strong><br style=\"margin: 0px; padding: 0px;\" />100 g cao đặc<a style=\"margin: 0px; padding: 0px; color: #1f7bb6; text-decoration-line: none; outline: 0px;\" href=\"http://baoveganmangvetailoc.ladopharquatangsuckhoe.vn/tim-hieu-ve-atiso-va-cong-dung-suc-khoe/\">acis&ocirc;</a>tương đương 3,5 kg l&aacute; tươi Actis&ocirc;.</p>\n<p style=\"margin: 0px; padding: 0px;\"><strong style=\"margin: 0px; padding: 0px;\">C&aacute;ch d&ugrave;ng:</strong>D&ugrave;ng 2-3 g mỗi lần, ng&agrave;y 2-3 lần.<br style=\"margin: 0px; padding: 0px;\" />H&ograve;a tan cao đặc Actis&ocirc; trong nước n&oacute;ng,<br style=\"margin: 0px; padding: 0px;\" />D&ugrave;ng th&ecirc;m đường hay mật ong t&ugrave;y th&iacute;ch.</p>\n<p style=\"margin: 0px; padding: 0px;\"><strong style=\"margin: 0px; padding: 0px;\">Bảo quản:</strong>Nơi kh&ocirc;, tr&aacute;nh &aacute;nh nắng trực tiếp.</p>\n<p style=\"margin: 0px; padding: 0px;\">Thực phẩm n&agrave;y kh&ocirc;ng phải l&agrave; thuốc, kh&ocirc;ng c&oacute; t&aacute;c dụng thay thế thuốc chữa bệnh.</p>\n</div>\n</div>\n</div>\n</div>\n</div>\n</div>\n</div>', 120000, 110000, NULL, NULL, NULL, 3, 1, 1, 1, '', '', '', NULL, NULL, NULL, 100),
