t-family: Nunito, sans-serif; font-size: 15px; background-color: #ffffff; line-height: 1.8; text-align: justify;\"><span id=\"docs-internal-guid-3402f059-7fff-867d-5b9c-389a1b590974\" style=\"box-sizing: border-box; margin: 0px; padding: 0px;\"><span style=\"box-sizing: border-box; margin: 0px; padding: 0px; font-size: 11pt; font-family: Arial; color: #000000; background-color: transparent; font-style: italic; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;\">Sacha Inchi, c&ograve;n được gọi l&agrave; đậu phộng Inca, l&agrave; loại c&acirc;y mọc ở rừng nhiệt đới Amazone v&agrave; v&ugrave;ng cao nguy&ecirc;n của Peru. C&aacute;c chuy&ecirc;n gia đ&atilde; v&iacute; loại hạt n&agrave;y l&agrave; một trong những si&ecirc;u thực phẩm l&agrave;nh mạnh nhất thế giới v&igrave; Sacha Inchi rất gi&agrave;u protein, omega-3, 6, 9, vitamin v&agrave; chất xơ. Kh&ocirc;ng chỉ c&oacute; nhiều lợi &iacute;ch cho sức khỏe m&agrave; hạt Sacha Inchi c&ograve;n c&oacute; t&aacute;c dụng giảm c&acirc;n, gi&uacute;p da v&agrave; t&oacute;c chắc khỏe. L&agrave; một trong những sản phẩm cao cấp của ch&uacute;ng t&ocirc;i, hạt Sacha Inchi rang cốt dừa v&ocirc; c&ugrave;ng thơm ngon v&agrave; gi&ograve;n rụm, mang lại cho bạn m&oacute;n ăn vặt vừa hấp dẫn vừa c&oacute; lợi cho sức khỏe.</span></span></p>\n<p style=\"box-sizing: border-box; margin: 0px; padding: 0px; color: #333333; font-family: Nunito, sans-serif; font-size: 15px; background-color: #ffffff;\"></p>\n<p dir=\"ltr\" style=\"box-sizing: border-box; margin: 0pt 0px; padding: 0px; color: #333333; font-family: Nunito, sans-serif; font-size: 15px; background-color: #ffffff; line-height: 1.8; text-align: justify;\"><span id=\"docs-internal-guid-3402f059-7fff-867d-5b9c-389a1b590974\" style=\"box-sizing: border-box; margin: 0px; padding: 0px;\"><span style=\"box-sizing: border-box; margin: 0px; padding: 0px; font-size: 11pt; font-family: Arial; color: #000000; background-color: transparent; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;\">Sau nhiều năm hoạt động v&agrave; ph&aacute;t triển, ch&uacute;ng t&ocirc;i đ&atilde; đạt được những th&agrave;nh tựu đ&aacute;ng kể v&agrave; c&aacute;c chứng chỉ uy t&iacute;n trong lĩnh vực chế biến n&ocirc;ng sản c&oacute; lợi cho sức khỏe: </span><span style=\"box-sizing: border-box; margin: 0px; padding: 0px; font-size: 11pt; font-family: Arial; color: #000000; background-color: transparent; font-weight: bold; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;\">H&agrave;ng Việt Nam Chất Lượng Cao, HACCP, ISO22000:2015, GMP</span><span style=\"box-sizing: border-box; margin: 0px; padding: 0px; font-size: 11pt; font-family: Arial; color: #000000; background-color: transparent; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;\">&hellip;</span></span></p>\n<p style=\"box-sizing: border-box; margin: 0px; padding: 0px; color: #333333; font-family: Nunito, sans-serif; font-size: 15px; background-color: #ffffff;\"></p>\n<p dir=\"ltr\" style=\"box-sizing: border-box; margin: 0pt 0px; padding: 0px; color: #333333; font-family: Nunito, sans-serif; font-size: 15px; background-color: #ffffff; line-height: 1.8; text-align: justify;\"><span id=\"docs-internal-guid-3402f059-7fff-867d-5b9c-389a1b590974\" style=\"box-sizing: border-box; margin: 0px; padding: 0px;\"><span style=\"box-sizing: border-box; margin: 0px; padding: 0px; font-size: 11pt; font-family: Arial; color: #000000; background-color: transparent; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;\">Sản phẩm của N&ocirc;ng L&acirc;m Food hiện nay đ&atilde; c&oacute; mặt tại khắp c&aacute;c cửa h&agrave;ng thực phẩm sạch, cửa h&agrave;ng đặc sản v&agrave; qu&agrave; tặng, c&aacute;c chuỗi hệ thống si&ecirc;u thị v&agrave; cửa h&agrave;ng tiện lợi tr&ecirc;n to&agrave;n quốc như </span><span style=\"box-sizing: border-box; margin: 0px; padding: 0px; font-size: 11pt; font-family: Arial; color: #000000; background-color: transparent; font-weight: bold; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;\">BigC, AEON, Lotte Mart, VinMart, CoopMart, Cirkle K, Ministop</span><span style=\"box-sizing: border-box; margin: 0px; padding: 0px; font-size: 11pt; font-family: Arial; color: #000000; background-color: transparent; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;\">....</span></span></p>\n<p dir=\"ltr\" style=\"box-sizing: border-box; margin: 0pt 0px; padding: 0px; color: #333333; font-family: Nunito, sans-serif; font-size: 15px; background-color: #ffffff; line-height: 1.8; text-align: justify;\"><span id=\"docs-internal-guid-3402f059-7fff-867d-5b9c-389a1b590974\" style=\"box-sizing: border-box; margin: 0px; padding: 0px;\"><span style=\"box-sizing: border-box; margin: 0px; padding: 0px; font-size: 11pt; font-family: Arial; color: #000000; background-color: transparent; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;\">Ngo&agrave;i ra, c&aacute;c sản phẩm tr&aacute;i c&acirc;y sấy nhiệt đới của ch&uacute;ng t&ocirc;i đ&atilde; được xuất khẩu v&agrave; y&ecirc;u th&iacute;ch tại nhiều nước tr&ecirc;n thế giới như </span><span style=\"box-sizing: border-box; margin: 0px; padding: 0px; font-size: 11pt; font-family: Arial; color: #000000; background-color: transparent; font-weight: bold; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;\">EU, &Uacute;c, Singapore, Nga</span><span style=\"box-sizing: border-box; margin: 0px; padding: 0px; font-size: 11pt; font-family: Arial; color: #000000; background-color: transparent; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;\">&hellip; v&agrave; c&aacute;c thị trường kh&oacute; t&iacute;nh kh&aacute;c như </span><span style=\"box-sizing: border-box; margin: 0px; padding: 0px; font-size: 11pt; font-family: Arial; color: #000000; background-color: transparent; font-weight: bold; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;\">Mỹ, Nhật</span><span style=\"box-sizing: border-box; margin: 0px; padding: 0px; font-size: 11pt; font-family: Arial; color: #000000; background-color: transparent; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;\">&hellip;</span></span></p>\n<p style=\"box-sizing: border-box; margin: 0px; padding: 0px; color: #333333; font-family: Nunito, sans-serif; font-size: 15px; background-color: #ffffff;\"><br style=\"box-sizing: border-box; margin: 0px; padding: 0px;\" /><span id=\"docs-internal-guid-3402f059-7fff-867d-5b9c-389a1b590974\" style=\"box-sizing: border-box; margin: 0px; padding: 0px;\"><span style=\"box-sizing: border-box; margin: 0px; padding: 0px; font-size: 11pt; font-family: Arial; color: #000000; background-color: transparent; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;\">Sản phẩm N&ocirc;ng L&acirc;m Food lu&ocirc;n được người ti&ecirc;u d&ugrave;ng ưa chuộng những khi nh&acirc;m nhi, thưởng thức c&ugrave;ng bạn b&egrave;, người th&acirc;n. Đặc biệt, đ&acirc;y c&ograve;n l&agrave; d&ograve;ng sản phẩm được kh&aacute;ch h&agrave;ng lựa chọn nhiều nhất để l&agrave;m </span><span style=\"box-sizing: border-box; margin: 0px; padding: 0px; font-size: 11pt; font-family: Arial; color: #000000; background-color: transparent; font-weight: bold; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;\">qu&agrave; tặng trong dịp Tết 2019</span><span style=\"box-sizing: border-box; margin: 0px; padding: 0px; font-size: 11pt; font-family: Arial; color: #000000; background-color: transparent; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;\"> vừa qua.</span></span></p>\n</div>', 200000, 150000, NULL, NULL, NULL, NULL, 1, 1, 1, '', '', '', NULL, NULL, NULL, 100),
